// src/components/HomePage.js
import React, { useState, useContext } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import logo from '../images/logo.png'; // Importa la imagen desde src
import '../App.css';
import { AuthContext } from '../context/authContext'; // Asegúrate de que la ruta sea correcta

const HomePage = () => {
  const [credentials, setCredentials] = useState({ rut: '', contrasena: '' });
  const { setAuth } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setCredentials({
      ...credentials,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:3000/api/auth/inicio', credentials);
console.log('Respuesta del servidor:',setAuth(response.data));
      
  
      // Redireccionar según el rol
      if (response.data.role === 'admin') {
        navigate('/admin');
      } else if (response.data.role === 'conductor') {
        navigate('/conductor');
      } else if (response.data.role === 'pasajero') {
        navigate('/pasajero');
      }
    } catch (error) {
      console.error('Error al iniciar sesión:', error);
      if (error.response) {
        // El servidor respondió con un estado fuera del rango de 2xx
        alert(`Error del servidor: ${error.response.status}`);
      } else if (error.request) {
        // La petición fue hecha pero no se recibió respuesta
        alert('No se recibió respuesta del servidor');
      } else {
        // Algo ocurrió al configurar la petición que provocó un error
        alert('Error al realizar la petición');
      }
    }
  };

  return (
    <div>
      <div className="container-fluid p-0">
        <img src={logo} alt="logo" style={{ width: '100%' }} />
      </div>

      <main className="main-content">
        {/* Primer container para Welcome y Login */}
        <div className="container-custom mb-5">
          <div className="row justify-content-center">
            <div className="col-md-5 d-flex align-items-center justify-content-center">
              <div className="d-flex flex-column justify-content-center" style={{ height: '100%' }}>
                <h2 className="text-welcome">¡Bienvenido!</h2>
              </div>
            </div>
            <div className="col-md-5 d-flex align-items-center justify-content-center">
              <div className="card bg-login">
                <div className="card-body">
                  <h2 className="text-login">Iniciar Sesión</h2>
                  <form onSubmit={handleSubmit} className="px-5 py-3">
                    <div className="form-group mb-3">
                      <label className="text-login1" htmlFor="rut">RUT</label>
                      <input
                        type="text"
                        name="rut"
                        className="form-control"
                        id="rut"
                        placeholder="Ingresa tu RUT"
                        value={credentials.rut}
                        onChange={handleChange}
                        required
                      />
                    </div>
                    <div className="form-group mb-4">
                      <label className="text-login1" htmlFor="password">Contraseña</label>
                      <input
                        type="password"
                        name="password"
                        className="form-control"
                        id="password"
                        placeholder="Ingresa tu contraseña"
                        value={credentials.password}
                        onChange={handleChange}
                        required
                      />
                    </div>
                    <div className="d-flex justify-content-center">
                      <button type="submit" className="btn btn-primary">Iniciar Sesión</button>
                    </div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Segundo container para Historia */}
        <div className="container-custom">
          <div className="row justify-content-center">
            <div className="col-sm-12 col-md-10 col-lg-8">
              <div className="card bg-historia text-historia">
                <div className="card-body">
                  <h2 className="card-title">Historia</h2>
                  <p className="card-text">Aquí puedes agregar información sobre la historia o más detalles de la aplicación.</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default HomePage;
